import {Text, View, StyleSheet, Image} from "react-native";

export default function Banner (props) {
	return (
		<View style={styles.container}>
			<Image style={styles.image} source={require("./../../assets/logo.png")}/>
		</View>
	);
}

const styles = StyleSheet.create({
	container: {
		// backgroundColor: "#fff",
		width: "80%",
		alignSelf:"center"
	},

	image: {
		height: 50,
		width: 50,
		resizeMode: "contain",
		// backgroundColor: "#fff"
	}
});
